import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import TabelaUsuarios from './TabelaUsuarios';
import UserDetails from './UserDetails';
import Escolhas from './Escolhas'; // Importando o arquivo Escolhas.js

import './App.css';

function App() {
  return (
    <Router>
      <div className="IterMob">
        <Routes>
          <Route path="/" element={<TabelaUsuarios />} />
          <Route path="/usuario/:id" element={<UserDetails />} />
          <Route path="/escolhas" element={<Escolhas />} /> {/* Nova Rota */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
